import React from 'react';

function Profile() {
  return (
    <div className="profile">
      <div className="column">
        <figure className="image">
        <img
          src={`${process.env.PUBLIC_URL}/profilephoto.jpg`}
          alt="Profile"
        />
        </figure>
      </div>
      <div className="column">
        <h2>Bohyeon Park | 박보현</h2>
        <p>I’m interested in Solutions Architecting and Cloud Engineering : )</p>
        <p>
          <mark className="highlight-orange_background"><code>Cloud Engineering</code></mark>
          <mark className="highlight-red_background"><code>Solutions Architect</code></mark>
          <mark className="highlight-blue_background"><code>AWS</code></mark>
          <code>GCP</code>
        </p>
      </div>
    </div>
  );
}

export default Profile;
